import mc from "./main.module.scss";
//components//
import PseudoInputs from "../inputs/pseudo/PseudoInputs";

const Main = () => {
  return (
    <div className={mc.container}>
      <div className={mc.players}>
        <div className={mc.player1}></div>
      </div>
    </div>
  );
};

export default Main;
